INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", 10046, 102301, 0.0, 0.0, 24, 2, 0.0, 24001, 401, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", 10046, 102301, 0.0, 2.21, 24, 2, 0.0, 24002, 402, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", 10046, 102301, 0.0, 0.0, 24, 2, 0.0, 24003, 403, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", 10046, 192201, 0.0, 1.99, 24, 1, 0.0, 24004, 701, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", 10046, 192201, 0.0, 2.21, 24, 2, 0.0, 24005, 702, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", 10046, 192201, 0.0, 3.33, 24, 1, 0.0, 24006, 703, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", 10046, 192301, 0.0, 0.0, 24, 2, 0.0, 24007, 801, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", 10046, 192301, 0.0, 2.68, 24, 2, 0.0, 24008, 802, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", 10046, 192301, 0.0, 0.0, 24, 2, 0.0, 24009, 803, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やった！", "", 10046, 192501, 0.0, 0.0, 24, 1, 0.0, 24010, 501, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("勝ったよ！", "", 10046, 192501, 0.0, 0.0, 24, 1, 0.0, 24011, 502, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい調子！", "", 10046, 192501, 0.0, 0.0, 24, 1, 0.0, 24012, 503, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", 10046, 113501, 0.0, 5.33, 24, 2, 0.0, 24013, 111, 6, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", 10046, 113501, 0.0, 6.85, 24, 2, 0.0, 24014, 112, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", 10046, 113501, 0.0, 3.0, 24, 2, 0.0, 24015, 113, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", 10046, 192401, 0.0, 6.11, 24, 2, 0.0, 24016, 611, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", 10046, 192401, 0.0, 6.75, 24, 2, 0.0, 24017, 612, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", 10046, 192401, 0.0, 0.0, 24, 2, 0.0, 24018, 613, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", 10046, 113401, 0.0, 4.52, 24, 1, 0.0, 24019, 211, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", 10046, 113401, 0.0, 3.89, 24, 1, 0.0, 24020, 212, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", 10046, 113401, 0.0, 13.49, 24, 2, 0.0, 24021, 213, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", 10046, 106501, 0.0, 3.17, 24, 2, 0.0, 24022, 311, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", 10046, 106501, 0.0, 4.42, 24, 2, 0.0, 24023, 312, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", 10046, 106501, 0.0, 2.89, 24, 1, 0.0, 24024, 313, 6, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", 10046, 102301, 0.0, 3.71, 24, 3, 0.0, 24025, 421, 4, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", 10046, 192201, 0.0, 5.1, 24, 1, 0.0, 24026, 721, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", 10046, 192301, 0.0, 4.34, 24, 3, 0.0, 24027, 821, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったよ\nまたやろうね", "", 10046, 192501, 0.0, 0.0, 24, 1, 0.0, 24028, 521, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", 10046, 113501, -360.0, 5.62, 24, 2, 0.0, 24029, 101, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", 10046, 113501, -360.0, 9.58, 24, 2, 0.0, 24030, 102, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", 10046, 113501, -360.0, 0.0, 24, 2, 0.0, 24031, 103, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", 10046, 113501, -360.0, 9.13, 24, 1, 0.0, 24032, 104, 2, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", 10046, 113501, -360.0, 8.27, 24, 2, 0.0, 24033, 105, 1, "2030/12/17 14:59:59", "2020/07/31 12:00:00");
